    render() {
        return (
            <Fragment>
                <ComponentF/>
                <UserConsumer>
                    {
                        (theValuePassed) => {
                            return <div>Component E:  {theValuePassed}</div>
                        }
                    }
                </UserConsumer>
            </Fragment>
        );
    }
}

export default ComponentE;
